private TaskAttempt getSuccessfulAttempt(Task task) {
  for(TaskAttempt attempt: task.getAttempts().values()) {
    if(attempt.getState() == TaskAttemptState.SUCCEEDED) {
      return attempt;
    }
  }
  return null;
}
